#!/usr/bin/env python3
# -*- coding: utf-8 -*-

import datetime
import random

class Example:
    """这是一个示例Python类"""
    
    def __init__(self, name):
        self.name = name
        self.created_at = datetime.datetime.now()
        
    def greet(self):
        """打印问候语"""
        print(f"你好，{self.name}！现在是 {self.created_at}。")
        
    def generate_random_numbers(self, count=5):
        """生成随机数列表"""
        return [random.randint(1, 100) for _ in range(count)]

if __name__ == "__main__":
    example = Example("测试用户")
    example.greet()
    print(f"随机数: {example.generate_random_numbers()}")


